import React, { Component } from 'react'
import Link from 'next/link';


class Navbar extends Component {

    state = {
        searchValue: ''
    }

    handleSearchChange = (asd) => {
       
        console.log(asd);

    }

    render() {
        return (
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
                <Link href='/'>
                    <a className='navbar-brand'>Imdb Project</a>
                </Link>
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>

                <div class="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul class="navbar-nav mr-auto">
                        <Link href='/other'>
                            <a className='nav-item nav-link'>My Favorites</a>
                        </Link>
                    </ul>
                    <form class="form-inline my-2 my-lg-0">
                        <input value={this.state.searchValue} onChange={handleSearchChange} class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
                        <button class="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
                    </form>
                </div>
            </nav>
        )
    }
}

export default Navbar;
